// src/App.tsx
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Header from './components/Header';
import ContentBoxes from './components/ContentBoxes';
import Footer from './components/Footer'; // Add a footer component if needed
import NotFound from './components/NotFound'; // Add a not found page if needed

const App: React.FC = () => {
    return (
        <Router>
            <div className="flex flex-col min-h-screen">
                <Navbar />
                <Header />
                <main className="flex-grow">
                    <Switch>
                        <Route path="/" exact component={ContentBoxes} />
                        {/* Add more routes here as needed */}
                        <Route component={NotFound} /> {/* 404 Not Found route */}
                    </Switch>
                </main>
                <Footer /> {/* Optional footer */}
            </div>
        </Router>
    );
};

export default App;
